import React from "react";
import { Link, useNavigate } from 'react-router-dom';
import calendarImage from "./NavbarReq/calendarImage.png";

const Navbar = ({ isLoggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Remove the token from localStorage or perform logout logic
    localStorage.removeItem('token');
    // Perform any additional cleanup if needed

    // Redirect to the desired route after logout
    navigate('/login'); // Redirect to the login page or any other appropriate route
  };

  return (
    <div className="container">
      <nav className="d-flex flex-wrap justify-content-center py-3 mb-4 border-bottom">
        <Link to="/" className="col-md-3 mb-2 mb-md-0 link-body-emphasis text-decoration-none">
          <img src={calendarImage} className="bi me-2" width="40" height="40" alt="Calendar" />
          <span className="fs-4">Minute Masters</span>
        </Link>

        <div className="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
          <Link to="/" className="nav-link px-2">Home</Link>
          {/* Dropdown or other navigation links */}
        </div>

        <div className="col-md-3 text-end">
          {isLoggedIn ? (
            /* If logged in, show logout button */
            <button type="button" className="btn btn-primary me-2" onClick={handleLogout}>Logout</button>
          ) : (
            /* If not logged in, show login and register buttons */
            <>
              <Link to="/login">
                <button type="button" className="btn btn-primary me-2">Login</button>
              </Link>
              <Link to="/register">
                <button type="button" className="btn btn-primary me-2">Register</button>
              </Link>
            </>
          )}
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
